import styled from "styled-components";

const HomeComponentStyle = styled(motion.div)``;

const HomeComponent = () => {
  return (
    <HomeComponentStyle>
      <div className="HomeComponentStyle">
        <div className="intro">
          <span className="welcome"> welcome to </span>
          <span className="logo"> deepand </span>
          <span className="text">
            “We Become What We Think About.” -Earl Nightingale
          </span>
        </div>
        <div className="introBg" />
        <div className="what we give">
          <span> we gave our visitor what they exactly want to read </span>
          <span>
            simple title with deep content could make them read the articles
            three times or more
          </span>
          <span>
            many articles type because of the good trafic we have and our newest
            authors ebery day
          </span>
        </div>
      </div>
    </HomeComponentStyle>
  );
};
export default HomeComponent;
